import React from 'react' 
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Pages from './Components/KitchenManager/Pages';
import SideBarKM from './Components/Headers/KitchenManager/KMSidebarData'
import './index.css'

function App() {

  return (
    <Router>
    <div className="App">                 
      <SideBarKM />
      <div className="mainPages">
        <Pages />
      </div>        
    </div>
  </Router>
  );
} 
      
export default App;
